  return (
    <React.Fragment>
      <Jumbotron title={"ALLISON WU"} />
      <NavigationBar />
      <Layout>
        <Router>
          <Switch>
            <Route exact path="/" component={HomePage} />
            <Route exact path="/projects" component={ProjectsPage} />
            <Route exact path="/experiences" component={ExperiencesPage} />
            <Route component={NoMatchPage} />
          </Switch>
        </Router>
      </Layout>
    </React.Fragment>
  );
}

export default App;
*/

class App extends Component {

  constructor(props) {
    super(props);
    this.state = {
      resumeData: {
        main: { name: "ALLISON WU" },
        resume: {
          skillmessage: "",
          education: [{ school: "school", degree: "degree", graduated: "graduated", description: "description" }],
          work: [{ company: "company", title: "title", years: "years", description: "description" }],
          skills: [{ name: "name", level: "level" }]
        },
        projects: [{ image: "image", title: "title", url: "url", category: "" }]
      }
    };
  }

  render() {
    const { resumeData } = this.state

    return (
      <div className="App">
        <Header data={[...resumeData.main]} />
        <About data={[...resumeData.main]} />
        <Resume data={[...resumeData.resume]} />
        <Projects data={[...resumeData.projects]} />
      </div>
    );
  }
}

export default App;
